import axios from "axios";

const url = "https://covid19.mathdro.id/api";

 const fetchData = async () => {
    try {
        const {data} = await axios.get(url);

        const modifiedData = {
            confirmed: data.confirmed,
            recovered: data.recovered,
            deaths: data.deaths,
            lastUpdate: data.lastUpdate
        }

        return modifiedData;
    } catch (error) {
        console.log(error);
    }
}
